            $result = $this->adminDB[$_SESSION["db_1"]]->query($sql);
            $row = $result->fetch_assoc();
            if ((float) $row["balance"] > (float) $data["point"]) {

                $sql = $this->ask_mysqli->_updateINC(array("balance" => "balance+" . $data["point"]), "agent") . $this->ask_mysqli->whereSingle(array("userid" => $data["userid"]));
                $this->adminDB[$_SESSION["db_1"]]->query($sql) != true ? array_push($error, $this->adminDB["db_1"]->error) : true;
                $sql = $this->ask_mysqli->_updateINC(array("balance" => "balance-" . $data["point"]), "admin") . $this->ask_mysqli->whereSingle(array("id" => 1));
                $this->adminDB[$_SESSION["db_1"]]->query($sql) != true ? array_push($error, $this->adminDB["db_1"]->error) : true;
                $sql = $this->ask_mysqli->insert("transaction", array("userid" => $data["userid"], "credit" => $data["point"], "remark" => "Admin Send Commission to Agent", "ip" => $_SERVER["REMOTE_ADDR"], "balance" => $this->getData($this->ask_mysqli->select("agent", $_SESSION["db_1"]) . $this->ask_mysqli->whereSingle(array("userid" => $data["userid"])), "balance")));
                $this->adminDB[$_SESSION["db_1"]]->query($sql) != true ? array_push($error, $this->adminDB["db_1"]->error) : true;
                $sql = $this->ask_mysqli->insert("transaction", array("userid" => 1, "debit" => $data["point"], "remark" => "Self Debit form admin to transfer balance", "ip" => $_SERVER["REMOTE_ADDR"], "balance" => $this->getData($this->ask_mysqli->select("admin", $_SESSION["db_1"]) . $this->ask_mysqli->whereSingle(array("id" => 1)), "balance")));
                $this->adminDB[$_SESSION["db_1"]]->query($sql) != 1 ? array_push($error, $this->adminDB["db_1"]->error) : true;
//                if (empty($error)) {
//                    $this->adminDB[$_SESSION["db_1"]]->commit();
//                    echo json_encode(array("toast" => array("success", "Agent", "Information Update Success... "), "status" => 1, "message" => "Agent Information Update Success.. "));
//                } else {
//                    $this->adminDB[$_SESSION["db_1"]]->rollback();
//                    $json_error = json_encode($error);
//                    echo json_encode(array("toast" => array("danger", "Agent", "Information Update Failed... {$json_error}"), "status" => 0, "message" => "Agent Information Update Failed.. {$json_error}"));
//                }
            }
        } catch (Exception $ex) {
            
        }
        return $error;
    }

